import logo from './logo.svg';
import './App.css';
import React, { useEffect, useState } from 'react';



function App() {
  const [data, setData] = useState({})

  useEffect(()=>{
    fetch("/members").then(
      response => response.json()
      ).then(
        data => {
          setData(data)
          console.log(data)
        }
      )
  }, [])
